def this_function(s: str) -> bool:
    ''' Check if the email contains a @ character, then the email shall not include any dot characters (.) after the @ character and before the end.'''
    if '@' in s:
        at_index = s.index('@')
        return '.' not in s[at_index+1:]
    return True  # If there's no '@', the condition is trivially satisfied

